import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const Carouselhome = () => {
    return (
        <div className='slider-container mx-auto p-2 w-45'>
            <Slider >
                <div className='slider mx-auto'>
                    <img src="/images/carousel/galaxy-s25-ultra.jpg" alt="Galaxy S25 Ultra" />
                </div>
                <div className='slider mx-auto'>
                    <img src="/images/carousel/iphone-15-pro.jpg" alt="iPhone 15 Pro" />
                </div>
            </Slider>
        </div>
    )
}
export default x
